import React, {useState} from 'react'

function Increment() {
    const [Count, setCount] = useState(0);
    const Increment = () =>{setCount(Count + 1);}
    return(Count, Increment);

}


export default function Count(){
    return(
        <div>
            <button onClick={Increment}>{Count}</button>
        </div>
    )
}
